  false,\n\t\"url\": null,\n\t\"notes\": \"The Polar Ecosystems Program conducts research
  and monitoring on phocid seals in the East Bering Sea, West Bering Sea, Gulf of
  Alaska, Beaufort Sea, and Chukchi Sea large marine ecosystems. Our research projects
  focus primarily on abundance, trends, distribution, and foraging behavior of harbor
  seals, ribbon seals, bearded seals, spotted seals, and ringed seals. As part of
  this work, deployment of satellite linked telemetry tags are a primary research
  tool. This data set represents all data from these tags deployed on all species
  and across a variety of research projects and collaborations from 2004 through 2013.
  Locations are calculated and provided by the Argos satellite system (http://www.argos-system.org/).
  In many cases, the data messages also include encoded behavior data (e.g. dive behavior,
  haul-out behavior) and additional software is required to decode these data. Data
  are, generally, in the same format as originally delivered from Argos/CLS America
  and no quality assurance or quality control measures have been implemented.n\",\n\t\"owner_org\":
